import { Col, Row } from "react-bootstrap";
import { useNavigate } from "react-router-dom";

import ManageGuide from "../../../assets/etc/manage_guide.png";
import MarketGuide from "../../../assets/etc/market_guide.png";

import style from "../../css/guide/Guide.module.css";

const Guide = () => {
  const navigate = useNavigate();

  return (
    <>
      <Row
        className={style["background"]}
        onContextMenu={(e) => {
          e.preventDefault();
        }}
      >
        <div style={{ marginTop: "auto", marginBottom: "auto" }}>
          <Row className={style["mainHead"]}>
            <div
              className={style["mainHead-menu"]}
              onClick={() => {
                navigate("/main");
              }}
            >
              PvE
            </div>
            <div
              className={style["mainHead-menu"]}
              onClick={() => {
                alert("차후 업데이트 예정");
              }}
            >
              PvP
            </div>
            <div
              className={style["mainHead-menu"]}
              onClick={() => {
                navigate("/manage");
              }}
            >
              구단관리
            </div>
            <div
              className={style["mainHead-menu"]}
              onClick={() => {
                navigate("/market");
              }}
            >
              이적시장
            </div>
            <div
              style={{ background: "rgba(5, 20, 48, 0.5)" }}
              className={style["mainHead-menu"]}
              onClick={() => {
                alert("차후 업데이트 예정");
              }}
            >
              가이드
            </div>
          </Row>
          <Row className={style["mainBody"]}>
            <Row>
              <Col>
                <Row className={style["manageHead"]}>
                  <div>구단 관리</div>
                </Row>
                <Row className={style["manageBody"]}>
                  <img
                    className={style["guideImg"]}
                    src={ManageGuide}
                    alt="manageguide"
                  ></img>
                  <div className={style["guideContent"]}>
                    1. 사용자는 구단 관리 페이지에서 <span>1번 영역</span>에서
                    자신의 보유 타자와 <span>2번, 3번 영역</span>에서 구원투수,
                    선발 로테이션 현황을 확인할 수 있습니다. <br />
                    2. 사용자는
                  </div>
                </Row>
              </Col>
              <Col>
                <Row className={style["marketHead"]}>
                  <div>이적 시장</div>
                </Row>
                <Row className={style["marketBody"]}>
                  <img
                    className={style["guideImg"]}
                    src={MarketGuide}
                    alt="manageguide"
                  ></img>
                  <div className={style["guideContent"]}>hi</div>
                </Row>
              </Col>
            </Row>
          </Row>
        </div>
      </Row>
    </>
  );
};

export default Guide;
